$('#phone_verify').on('submit', function (event) {
  event.preventDefault();
  var input = $('input[name=phone_code]');
  var code = input.val();
  var type = 'phone_code';
  $.ajax({
    type: 'POST',
    dataType: 'json',
    url: '/verification/verify-code',
    headers: {
      'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
    },
    data: {
      code: code,
      type: type
    },
    success: function success(data) {
      var verification = $('#verification-phone-response');

      if (data.success) {
        verification.text(data.success);
        verification.css('color', 'green');
        input.removeClass('is-invalid');
        input.addClass('is-valid');
        $('#send-phone-verification').addClass('disabled');
        setTimeout(function () {
          $('#phone-verify').modal('toggle');
        }, 1500); // Segment trancking

        verificatePhone();
      } else {
        input.removeClass('is-valid');
        input.addClass('is-invalid');
        verification.text(data.failure);
        verification.css('color', 'red');
      }
    }
  });
  return false;
});
